import React from "react";
import { NavLink } from "react-router-dom";
import styled from "styled-components";
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';

const Navbar = () => {
  const Nav = styled.nav`
    .navbar_list {
      display: flex;
      align-items: center;
      gap: 5rem;

      .navbar_link {
        &:link,
        &:visited {
          font-size: 1.4rem;
          font-weight: 500;
          display: inline-block;
          text-decoration: none;
          list-style: none;
          color:${({theme}) => theme.colors.text};
          transition:color 0.3s linear;
        }
        &:active{
          color:white;
          background-color:${({theme}) => theme.colors.heading};
          border-radius:.5rem;
          cursor: pointer;
        }
        &:hover{
          color:${({theme}) => theme.colors.text};
          opacity:.4;
          cursor: pointer;
        }


          position:relative;

          .cart_trolley{
            position:relative;
            font-size:2.2rem;

          }
         .cart_items{
          width: 1.8rem;
          height:1.8rem;
          background-color:#8DA9F1;
          color:${({theme}) => theme.colors.text};
          border-radius:50%;
          display:grid;
          position:absolute;
          top:-20%;
          left:73%;
          font-size:1.2rem;
         }
        }
      }

    }
  `;
  return (
    <>
      <Nav>
        <div className="navbar">
          <ul className="navbar_list">
            <li>
              <NavLink className="navbar_link active" to="/home">
                Home
              </NavLink>
            </li>

            <li>
              <NavLink className="navbar_link" to="/about">
                About
              </NavLink>
            </li>

            <li>
              <NavLink className="navbar_link" to="/contact">
                Contact
              </NavLink>
            </li>

            <li>
              <NavLink className="navbar_link" to="/services">
                Services
              </NavLink>
            </li>
            <li>
              <NavLink className="navbar_link cart-trolley-link" to="/cart">
                <ShoppingCartIcon className="cart_trolley" /> <span className="cart_items">10</span>
              </NavLink>
            </li>
          </ul>
        </div>
      </Nav>
    </>
  );
};

export default Navbar;
